    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - 35 - - col0 * col0 IS NULL OR ( CAST ( NULL AS INTEGER ) * col0 + + col0 ) NOT BETWEEN col2 AND ( + col1 );
  - name: tab1

outputs:
  - name: q12267.out
    data: |
      51	14	96
      85	5	59
      91	47	68
